import * as React from "react";
import Box from "@mui/material/Box";
import Button from "@mui/material/Button";
import ButtonGroup from "@mui/material/ButtonGroup";
import Pages from "../Pages";
import { Typography } from "@mui/material";

function menuState({string}) {
  let page = string
  return (
    <Typography>({page})</Typography>
  )
}

export default function Menu() {
  return (
    <Box
      sx={{
        display: "flex",
        alignItems: "top",
        textAlign: "center",
        bgcolor: "black",
        borderRadius: 5,
        color: "white",
        justifyContent: "space-between",
        padding: "15px 15px 15px 15px",
      }}
    >
      <Box>
        <ButtonGroup sx={{color:"#fff"}} variant="outlined" aria-label="outlined button group">
          <Button onClick={menuState}>About Me</Button>
          <Button onClick={menuState}>Projects</Button>
          <Button onClick={menuState}>Contact</Button>
        </ButtonGroup>
      </Box>
    </Box>
  );
}
